import React, { Component } from "react";
import Slider from "react-slick";

import OwlCarousel from 'react-owl-carousel';
export default class TopSelling extends Component {
    render() {
        // const settingTopSelling = {
        //     autoplaySpeed: 1000,
        //     infinite: true,
        //     speed: 10,
        //     slidesToShow: 5,
        //     slidesToScroll: 5
        // };
        return (


            <section className="TopSelling">
                <div className="container">
                    <div className="row">
                        <div className="col-sm-12 col-md-12 col-lg-12 col-xl-12">
                            <h3 className="title">
                                Top Selling
                            </h3>
                        </div>
                        <div className="col-sm-12 col-md-12 col-lg-12 col-xl-12 viewing__content">
                            <div className="product__items">
                                <div className="product__item">
                                    <a href="">
                                        <div className="item__img">
                                            <img src="./img/item1.jpg" alt=""/>
                                            <div className="img__overplay"></div>
                                        </div>
                                        <div className="item__info">
                                            <h5>Node.js, Express & MongoDB Dev to Deployment</h5>
                                            <h6>Jose Portilla</h6>
                                            <div className="raiting">
                                                <i className="fa fa-star"></i>
                                                <i className="fa fa-star"></i>
                                                <i className="fa fa-star"></i>
                                                <i className="fa fa-star"></i>
                                                <i className="fa fa-star"></i>
                                            </div>
                                            <div className="price">
                                                <div className="old__price">$199.99</div>
                                                <div className="new__price">$199.99</div>
                                            </div>
                                        </div>
                                    </a>
                                    <span className="best__seller"></span>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        );
    }
}
